package awesomeatomone

import (
	"strings"

	mb "gno.land/p/demo/microblog"
	"gno.land/p/nt/ufmt"
	susers "gno.land/r/sys/users"
)

var (
	title = "Awesome AtomOne Microblog"
	// This determines the per-user page URLs:
	// /r/meeeshell222/awesomeatomone:<ADDRESS>
	prefix = "/r/meeeshell222/awesomeatomone:"
	m      *mb.Microblog
)

func init() {
	m = mb.NewMicroblog(title, prefix)
}

// -----------------------------------------------------------------------------
// RENDER HELPERS
// -----------------------------------------------------------------------------

func renderHome() string {
	output := ufmt.Sprintf("# %s\n\n", m.Title)
	output += "## Pages\n\n"

	for _, page := range m.GetPages() {
		if u := susers.ResolveAddress(page.Author); u != nil {
			output += ufmt.Sprintf(
				"- [%s (%s)](%s%s)\n",
				u.Name(),
				page.Author.String(),
				m.Prefix,
				page.Author.String(),
			)
		} else {
			output += ufmt.Sprintf(
				"- [%s](%s%s)\n",
				page.Author.String(),
				m.Prefix,
				page.Author.String(),
			)
		}
	}

	return output
}

func renderUser(user string) string {
	silo, found := m.Pages.Get(user)
	if !found {
		return "404"
	}

	return pageToString(silo.(*mb.Page))
}

// -----------------------------------------------------------------------------
// RENDER ENTRYPOINT
// -----------------------------------------------------------------------------

// Render routes:
//
//	""          -> home (list of pages)
//	"<address>" -> that user's microblog page
func Render(path string) string {
	parts := strings.Split(path, "/")

	isHome := path == ""
	isUser := len(parts) == 1

	switch {
	case isHome:
		return renderHome()
	case isUser:
		return renderUser(parts[0])
	default:
		return "404"
	}
}

// -----------------------------------------------------------------------------
// PAGE RENDERING
// -----------------------------------------------------------------------------

func pageToString(p *mb.Page) string {
	o := ""

	if u := susers.ResolveAddress(p.Author); u != nil {
		o += ufmt.Sprintf("# [%s](/u/%s)\n\n", u.Name(), u.Name())
	}

	o += ufmt.Sprintf(
		"## [%s](%s%s)\n\n",
		p.Author.String(),
		m.Prefix,
		p.Author.String(),
	)

	o += ufmt.Sprintf(
		"joined %s, last updated %s\n\n",
		p.CreatedAt.Format("2006-01-02"),
		p.LastPosted.Format("2006-01-02"),
	)

	o += "## feed\n\n"
	for _, u := range p.GetPosts() {
		o += u.String() + "\n\n"
	}

	return o
}

